The Session::Run method doesn't take std::vector<Value> as input since that would require all users to store their inputs into vectors. It's fairly easy to use .data() and .size() to pass a vector in through it. Of course, if this is a common request we'll probably add a method that does this for convenience!

To wrap that API you'll need to create an Ort::Value out of the input data. You should be able to do something like this (typed directly, so might have some mistakes):

    std::vector<std::array<float, 5>> Predict(const std::vector<std::array<float, 224 * 224 * 3>>& ins) {
    {
    Ort::AllocatorInfo allocator_Info = Ort::AllocatorInfo::CreateCpu(OrtArenaAllocator, OrtMemTypeDefault);
    std::vector<int64_t> ins_shape{ 224, 224, 3};
    Ort::Value input_tensor = Ort::Value::CreateTensor(allocator_info, ins.data(), ins.size(), ins_shape.data(), ins_shape.size());
   // Now pass input_tensor into Run()...

You can't pass any memory directly into Run() but you can create a tensor out of the memory directly.

Were you able to get it to work using that?

Ah, well 'ins' is a vector of the arrays, so you'll need to pass in one of them:

    std::vector<std::array<float, 5>> Predict(std::vector<std::array<float, 224 * 224 * 3>>& ins) {
    {
        Ort::AllocatorInfo allocator_Info = Ort::AllocatorInfo::CreateCpu(OrtArenaAllocator, OrtMemTypeDefault);
        std::vector<int64_t> ins_shape{ 224, 224, 3};
        Ort::Value input_tensor = Ort::Value::CreateTensor(allocator_info, ins[0].data(), ins[0].size(), ins_shape.data(), ins_shape.size());

Does that help clarify it? (see the 'ins' to 'ins[0]' change on the CreateTensor line)

```
std::vector<std::array<float, 5>> Predict(const std::vector<std::array<float, 224 * 224 * 3>>& ins) {
	std::vector<std::array<float, 224 * 224 * 3>> ret;
	Ort::AllocatorInfo allocator_info= Ort::AllocatorInfo::CreateCpu(OrtArenaAllocator, OrtMemTypeDefault);
	std::vector<int64_t> ins_shape{ 224, 224, 3 };
	for (int i = 0; i < ins.size(); i++) {
		Ort::Value input_tensor = Ort::Value::CreateTensor(allocator_info, ins[i].data(), ins[i].size(), ins_shape.data(), ins_shape.size());
		auto output_tensors = session.Run(Ort::RunOptions{ nullptr }, input_node_names.data(), &input_tensor, 1, output_node_names.data(), 1);
		std::array<float, 224 * 224 * 3> t = SomeTransform(output_tensors);
		ret.push_back(t);
	}
	return ret;
}
```
